This is possibly the most complex part of the code, so what follows is a long explanation for it. In our fibonacci example, after obtaining the trace polynomial t by interpolating, the transition constraint polynomial is C(x)=∏i=05​(x−gi)t(xg2)−t(xg)−t(x)​ On our prove code, if someone passes us a fibonacci AIR like the one we showed above used in one of our tests, we somehow need to construct C(x). However, what we are given is not a polynomial, but rather this method fn compute_transition( &self, frame: &air::frame::Frame<Self::Field>, ) -> Vec<FieldElement<Self::Field>> { let first_row = frame.get_row(0); let second_row = frame.get_row(1); let third_row = frame.get_row(2); vec![third_row[0] - second_row[0] - first_row[0]]
} So how do we get to C(x) from this? The answer is interpolation. What the method above is doing is the following: if you pass it a frame that looks like this ​t(x0​)t(x0​g)t(x0​g2)​​ for any given point x0​, it will return the value t(x0​g2)−t(x0​g)−t(x0​) which is the numerator in C(x0​). Using the transition_exemptions field we defined in our AIR, we can also compute evaluations in the denominator, i.e. the zerofier evaluations. This is done under the hood by the transition_divisors() method. The above means that even though we don't explicitly have the polynomial C(x), we can evaluate it on points given an appropriate frame. If we can evaluate it on enough points, we can then interpolate them to recover C(x). This is exactly how we construct both transition constraint polynomials and subsequently the composition polynomial H. The job of evaluating H on enough points so we can then interpolate it is done by the ConstraintEvaluator struct. You'll notice prove does the following let constraint_evaluations = evaluator.evaluate( &lde_trace, &lde_roots_of_unity_coset, &alpha_and_beta_transition_coefficients, &alpha_and_beta_boundary_coefficients,
); This function call will return the evaluations of the boundary terms Bi​(x)(αi​xD−deg(B)+βi​) and constraint terms Ci​(x)(αi​xD−deg(C)+βi​) for every i. The constraint_evaluations value returned is a ConstraintEvaluationTable struct, which is nothing more than a big list of evaluations of each polynomial required to construct H. With this in hand, we just call let composition_poly = constraint_evaluations.compute_composition_poly(& lde_roots_of_unity_coset); which simply interpolates the sum of all evaluations to obtain H. Let's go into more detail on how the evaluate method reconstructs C(x) in our fibonacci example. It receives the lde_trace as an argument, which is this: ​t(ω0)t(ω1)…t(ω15)​​ where ω is the primitive root of unity used for the LDE, that is, ω satisfies ω2=g. We need to recover C(x), a polynomial whose degree can't be more than t(x)'s. Because t was built by interpolating 8 points (the trace), we know we can recover C(x) by interpolating it on 16 points. We choose these points to be the LDE roots of unity {ω0,ω,ω2,…,ω15} Remember that to evaluate C(x) on these points, all we need are the evaluations of the polynomial t(xg2)−t(xg)−t(x) as the zerofier ones we can compute easily. These become: t(ω0g2)−t(ω0g)−t(ω0)t(ωg2)−t(ωg)−t(ω)t(ω2g2)−t(ω2g)−t(ω2)⋮t(ω15g2)−t(ω15g)−t(ω15) If we remember that ω2=g, this is t(ω4)−t(ω2)−t(ω0)t(ω5)−t(ω3)−t(ω)t(ω6)−t(ω4)−t(ω2)⋮t(ω3)−t(ω)−t(ω15) and we can compute each evaluation here by calling compute_transition on the appropriate frame built from the lde_trace. Specifically, for the first evaluation we can build the frame: ​t(ω0)t(ω2)t(ω4)​​ Calling compute_transition on this frame gives us the first evaluation. We can get the rest in a similar fashion, which is what this piece of code in the evaluate method does: for (i, d) in lde_domain.iter().enumerate() { let frame = Frame::read_from_trace( lde_trace, i, blowup_factor, &self.air.context().transition_offsets, ) let mut evaluations = self.air.compute_transition(&frame); ...
} Each iteration builds a frame as above and computes one of the evaluations needed. The rest of the code just adds the zerofier evaluations, along with the alphas and betas. It then also computes boundary polynomial evaluations by explicitly constructing them.

